function Contact() {
  return (
    <div className="flex h-screen items-center justify-center flex-col">
      <div>
        <img src="https://www.wallpapertip.com/wmimgs/66-666819_website-design-background-creative-background-image-for-website.jpg"></img>
      </div>
      <h1 className="text-3xl font-bold">This is contact page</h1>
      <p>Under Construction</p>
      <i class="fa-solid fa-person-digging fa-fw"></i>
    </div>
  );
}

export default Contact;
